import styled from "styled-components"
import border from "../styled/border"
export const SearchWrap=border(styled.div`
    padding:.1rem .15rem;
    div{
        
        display:flex;
        justify-content:center;
        align-items:center;
        height:.4rem; 
        color:#666;
        background:#fff;
        img{
            width:.22rem;
            height:.22rem;
            margin-right:.05rem;
        }
    }
    
    `
)
